async (currencyCode) => {

		const params= { currencyCode };	
		return selectCurrentCurrencies.run(undefined, undefined, params).then((response) => {
			if(response.length === 1) {
					showAlert(`Not Insert: ${currencyCode}`);
					return;
			} else {
					return insertCurrencyBnkAccInfo.run(undefined, undefined, params).then(async (response) => {
						if(response.length === 1) {
							showAlert(`Inserted: ${currencyCode}`);
						} else {
							showAlert(`Incorrect insertion: ${currencyCode}`);
						}
					});
			}
		});
	}
